var github=function(){function n(n){return $("<div/>").text(n).html()}function t(t,i){for(var r=0,u="",f=$(t)[0],r=0;r<i.length;r++)u+='<li><a href="'+i[r].html_url+'">'+i[r].name+"<\/a><p>"+n(i[r].description||"")+"<\/p><\/li>";f.innerHTML=u}return{showRepos:function(n){$.ajax({url:"https://api.github.com/users/"+n.user+"/repos?sort=pushed&callback=?",dataType:"jsonp",error:function(){$(n.target+" li.loading").addClass("error").text("Error loading feed")},success:function(i){var u=[],r;if(i&&i.data){for(r=0;r<i.data.length;r++)n.skip_forks&&i.data[r].fork||u.push(i.data[r]);n.count&&u.splice(n.count);t(n.target,u)}}})}}}()